function Header() {
    const client = "designer";
    const title = {
        designer: "Design",
        programmer: "Programming"
    }
    const info = {
        name: "hichem",
        nick: "hicm"
    }
    return (
        <div className="navbar bg-dark rounded text-white">
            {`Hello ${info.name} ${info.nick}`}
            <h2>{client == "designer" ? title.designer : title.programmer}
                is my life</h2>
            </div>
    )
}

export default Header;
